import React, { Component } from "react";
import Nav from "./components/Nav";

class App extends Component {
  constructor() {
    super();
    this.pages = ['Home','About me','Blog', 'Images','Links'];
  }

  render() {
    return (
      <div className="App container">
        <Nav/>
         />
      </div>
    );
  }
}

export default App;
